<!DOCTYPE HTML>
<html>
<head>
<script src="queue.js" ></script>
<script src="stack.js" ></script>

</head>
<body>
	<script type="text/javascript">
		for (var i = 0; i < 10000; i++) {
			var number = i;
			number = new Stack();

			for (var j = 0; j < 10; j++) {
				number.push(j);
			}
		}
		for (var i = 0; i <= 10000; i++) {
			var number = i;
			number = new Queue();
			for (var j = 0; j < 10; j++) {
				number.enqueue(j);
			}
		}
	</script>
</body>
</html>
